			rating: 0,
			cleanliness: 5,
			comment: ''
		};
	}

	render() {
		const { rating, cleanliness, comment } = this.state;
		return (
			<div>
				<h2>Write Review</h2>
				<div>
					<div>
						<div className='rhi'>
							<StarRatingComponent
								starCount={5}
								starColor={
									'#00A699'
								}
								value={
									cleanliness
								}
							/>
							<h3>Cleanliness</h3>
						</div>
					</div>
				</div>
			</div>
		);
	}
}

export default ReviewWrite;
